const weatherData = [
    { day: "TONIGHT", date: "11/30", temp: "16°", condition: "Clear", icon: "fas fa-moon", precip: "2%" },
    { day: "SUN", date: "12/1", temp: "27° 20°", condition: "Partly sunny", nightCondition: "Night: Partly cloudy", icon: "fas fa-cloud-sun", precip: "1%" },
    // ... other days
];

export default weatherData;
